import { useEffect, useState } from "react";
import { useParams } from "react-router-dom";

const Genre = () => {
  const [item, setItem] = useState({});

  let { id } = useParams();

  useEffect(() => {
    let data = [
      {
        id: 1,
        name: "Comedy",
      },
      {
        id: 2,
        name: "Action",
      },
    ];
    setItem(data);
  }, [id]);

  return (
    <div>
      <h3 className="text-center">Genre</h3>
      <div className="container">
        <div className="row">
          <div className="col">
            <h2>
              {" "}
              {item.id} {item.name}{" "}
            </h2>
          </div>
        </div>
      </div>

      <hr />
    </div>
  );
};

export default Genre;
